function fetchData(r,e){return fetch(r).then(r=>{if(!r.ok)throw 403===r.status?new Error("API rate limit exceeded"):new Error("Failed to fetch data");return r.json()}).catch(t=>{if("API rate limit exceeded"===t.message&&e)return fetch(e+encodeURIComponent(r)).then(r=>{if(!r.ok)throw new Error("Failed to fetch data via proxy");return r.json()}).catch(r=>{throw new Error("Error fetching data via proxy: "+r.message)});throw new Error("Error: "+t.message)})}function fetchMarkdown(r){return fetch(r).then(r=>{if(!r.ok)throw new Error("Network response was not ok");return r.text()}).then(r=>{parseMarkdownToHTML(r)}).catch(r=>{throw new Error("Fetch error: "+r.message)})}const repoUrl="https://api.github.com/repos/swas02/NeutralAXIS/contents/Web",rawUrl="https://raw.githubusercontent.com/swas02/NeutralAXIS/main/",proxyUrl="https://api.allorigins.win/raw?url=",rootURL="https://swas02.github.io/NeutralAXIS";fetchData(repoUrl,proxyUrl).then(r=>{populateHomeSection(r),console.log(r)}).catch(r=>{console.error(r.message)});